//Fonction qui permet de charger un fichier pour un input
function load_file(value){
  $("#fileInput"+value).show();
  var fileInput = document.getElementById('fileInput'+value);
  fileInput.addEventListener('change', function(e) {
    var file = fileInput.files[0];
    var reader = new FileReader();
    reader.onload = function(e) {
     $('#newLoadData'+value).fadeOut('slow');
     $('#fileInput'+value).fadeOut('slow');
     $("#dataFieldArea"+value).text(reader.result);
     $('#par'+value).text("Loaded File : "+file.name);
   };
   reader.readAsText(file);  
 });   
}




//Fonction qui charge tout le circos
function load_circos(){


  document.getElementById("lineChart").innerHTML = "";
  //On crée une nouvelle instance in case of
  circos = new Circos({
    container: '#lineChart', 
    width: width,
    height: width
  })
  //On commence par initialiser le layouut du circos
  circos.layout(chromosomeParser($("#dataFieldAreaC").val()),layoutConfig(6000000,'Mb'));

  var scattercpt=1; //Compte le nombre de scatter dans le circos
  var representationcpt = 0; //Compte le nombre de track globales dans le circos
  var circosOrientation = "out"; //Orientation du circos (vers l'interrieur ou l'exterieur)
  
  //Fonnction qui permet de définir l'orientation du circos si ce dernier ccontient des chords il va etre de type out et inversement
  for(var i = 0; i < id; i++){
    var selected = $('#selectType'+i).val();
    if(selected =="Chords"){
      circosOrientation = "out";
    }
  }

  console.log("orientation : " + circosOrientation);

  //La grosse fonction super lourde de la mort qui tue : Boucle qui parcourt toutes les track et qui les ajoute au circos
  for(var i = 0; i < id; i++){

    //progress bar:
    var progWidth = i/(id-1)*100;
    document.getElementById("progBar").style.width = progWidth+"%";

    var selected = $('#selectType'+i).val();     //récupère la séléction pour chaque track le type de la track
    var content  = $('#dataFieldArea'+i).val();  //récupère les données
    $('#'+i).click(function(event){               // Empeche la fermeture au clic
     event.stopPropagation();
   });
    //Switch pour les types de track 
    switch(selected){
      case "HeatMap":
      var data = heatmapParser(content)
      if(data.length>1){
        for(var r = 0; r<data.length;r++){
          circos.heatmap(randomId(),heatmapVarMapper(data[r]),heatmapConfig(representationcpt,"RdBu",circosOrientation,data.length,r));
        }
        representationcpt++;
      }else{
        circos.heatmap(randomId(),heatmapVarMapper(data[0]),heatmapConfig(representationcpt,"RdBu",circosOrientation,1,0));
        representationcpt++;
      }
      break;
      case "Line":
      var data = lineParser(content);
      if(data.length>1){
        for(var r = 0; r<data.length;r++){
          circos.line(randomId(), lineVarMapper(data[r]),lineConfig(representationcpt,circosOrientation,data.length));
          circos.scatter(randomId(), lineVarMapper(data[r]),lineScatterConfig(representationcpt,circosOrientation));
          lineScatterConfig
        }
        representationcpt++;
      }
      else{
        circos.line(randomId(), lineVarMapper(data[0]),lineConfig(representationcpt,circosOrientation,1));
        circos.scatter(randomId(), lineVarMapper(data[0]),lineScatterConfig(representationcpt,circosOrientation));
        representationcpt++;
      }
      break;
      case "Chords":
      circos.chords(randomId(),chordVarMapper(chordsParser(content)),chordConfig("1"));
      if(inversions.length>0){
        circos.chords(randomId(),chordVarMapper(inversions),chordConfig("2"));
        inversions = [];
      }
      break;
      case "HighLight":
      circos.highlight(randomId(), cytobandsVarMapper(cytobandsParser(content)),highlightConfig())
      break;
      case "Histogram":
      circos.histogram(randomId(), histogramVarMapper(histogramParser(content)) ,histogramConfig(representationcpt,circosOrientation));
      representationcpt++;
      break;
      case "Scatter":
      if(circosOrientation == "out"){
        circos.scatter(randomId(), scatterVarMapper(scatterParser(content)),scatterConfig(representationcpt,circosOrientation));
        representationcpt++;
      }
      else{
        circos.scatter(randomId(), scatterVarMapper(scatterParser(content)),scatterConfig(scattercpt,circosOrientation));
      }
      scattercpt++;
      break;
      case "Stack":
      if(circosOrientation == "out"){
        circosOrientation = "in";
        //console.log("DEBUG STACK if orientation : " + circosOrientation);
        circos.stack(randomId(), stackVarMapper(stackParser(content)),stackConfig(representationcpt,circosOrientation));
        representationcpt++;
      }else{
        //console.log("DEBUG STACK else orientation : " + circosOrientation);
        circos.stack(randomId(), stackVarMapper(stackParser(content)),stackConfig(representationcpt,circosOrientation));
        representationcpt++;
      }
      break;
      case "Text":
      break;
    } 
  }
  circos.render();
  $("#chrselectli").show();
  if(!$("#resetZoom").is(":visible")){
    $("#resetZoom").fadeIn('slow');


  }

  $(function() {
    panZoomInstance = svgPanZoom('#svgdemo', {
      zoomEnabled: true,
      controlIconsEnabled: false,
      fit: true,
      center: true,
      minZoom: 0.1
    });

    document.getElementById('resetZoom').addEventListener('click', function(ev){
      ev.preventDefault()
      panZoomInstance.resetZoom()
      panZoomInstance.resize();
      panZoomInstance.fit();
      panZoomInstance.center();
    });

  // zoom out
  panZoomInstance.zoom(1)
})
  
}
